            new TranslationEntryList() { Id = Guid.Parse("1c6eeec1-fe70-4fc5-8b45-df4a2255dea6"), LanguageCode = "nno", Type = nameof(Role), Translations = { { "Name" , "Privatperson" } ,                                  { "Description" , "Privatperson" } } },
            new TranslationEntryList() { Id = Guid.Parse("e16ab886-1e1e-4f45-8f79-46f06f720f3e"), LanguageCode = "nno", Type = nameof(Role), Translations = { { "Name" , "Sjølregistrert brukar" } ,                         { "Description" , "Sjølregistrert brukar" } } },
        };

        db.Database.SetAuditSession(AuditValues);

        foreach (var d in data)
        {
            var obj = db.Roles.FirstOrDefault(t => t.Id == d.Id);
            if (obj == null)
            {
                db.Roles.Add(d);
            }
            else
            {
                obj.Name = d.Name;
            }
        }

        foreach (var translation in translations.SelectMany(t => t.SingleEntries()))
        {
            await translationService.UpsertTranslation(translation);
        }

        var result = await db.SaveChangesAsync();
    }
